import React from 'react';
import './slideShow.style.css'

const SlideShow = ({property}) => {
    const {index, pictur} = property;
    return (
        <div id={`card-${index}`} className="card">
            <img src={picture}/>
        </div>
    )
}

export default SlideShow;
